 here are the links we mentioned.</div>\r\n<div style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">SPARCS resources include workshops on: GameMaker, Android AppInventor, CSUnplugged, WebDesign, Lego Mindstorms, Logic/Circuitry, Security & Encryption.</div>\r\n<div style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"></div>\r\n<div>\r\n<ul>\r\n<li style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">SPARCS resources + lesson plans & 5 years of feedback data: <a href=\"https://sites.google.com/a/ncsu.edu/sparcs-resources/\" target=\"_blank\" style=\"color: #1155cc;\">https://sites.google.com/a/ncsu.edu/sparcs-resources/<br /> </a></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">UNC Charlotte SPARCS page (resources used in weekly format + monthly format): <a href=\"http://unccslc.starsalliance.org/sparcs\" target=\"_blank\" style=\"color: #1155cc;\">http://unccslc.starsalliance.org/sparcs<br /> </a></span></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">NCSU SPARCS page (resources used in monthly format): <a href=\"http://research.csc.ncsu.edu/stars/sparcs\" target=\"_blank\" style=\"color: #1155cc;\">http://research.csc.ncsu.edu/stars/sparcs<br /> </a></span></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">School pages were made using Drupal (free + out of the box ready to use): <a href=\"http://drupal.org/\" target=\"_blank\" style=\"color: #1155cc;\">http://drupal.org/</a></span></li>\r\n</ul>\r\n</div>\r\n</p>','groups.discussion','',69,42,0,0,0,'2012-08-17 13:01:53',0,'{\"action\":\"group.discussion.create\",\"topic_id\":69,\"topic\":\"SPARCS outreach materials\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=42\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=42&topicid=69\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(764,77,277,'Hi Nai,\n\nI wanted to give you a heads up that I have been in contact with Ebonie from Hickory Grove, and we are looking into ways we can do outreach through STARS with them.  Thanks for suggesting STARS to her, and I will keep you in the loop when we get something going so you can keep involved!\n\nRegards,\nScott','','profile','',77,NULL,NULL,0,0,'2011-09-29 20:46:20',20,'',1,1,'',255,255,764,'profile.status',764,'profile.status'),(766,104,104,'We\'ve posted a photo release form for you all to collect whenever you take pictures (at outreach events)- use if you want to publish the pictures or video that you take :)','','profile','',104,NULL,NULL,0,0,'2011-09-30 14:59:30',20,'',1,1,'',255,255,766,'profile.status',766,'profile.status'),(763,118,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>New Members</a> group','<p>Hello all!  I just uploaded some files to the \"New Members\" folder found under \"Sharing -> Resources\".  Melinda and Sandy created these files and had a good turnout at the first STARS information session at SSC on Monday evening.  We thought we would post the PPT presentation, Flyer and Invitation Letter for anyone else that might want to take a look!  Hope all is well!</p>','groups.discussion','',18,NULL,NULL,0,0,'2011-09-29 20:13:07',20,'{\"action\":\"group.discussion.create\",\"topic_id\":18,\"topic\":\"Recruiting Resources\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=40\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=40&topicid=18\"}',1,1,'',255,255,0,'',0,''),(765,104,104,'Hi everyone- Students, make sure you sign an SLC Consent form; faculty, make sure you sign the faculty consent form. Both are in the Sharing tab.','','profile','',104,NULL,NULL,0,0,'2011-09-30 14:58:35',20,'',1,1,'',255,255,765,'profile.status',765,'profile.status'),(759,315,153,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-09-29 02:48:22',20,'',1,1,'',255,255,0,'',0,''),(760,153,291,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-09-29 03:04:12',20,'',1,1,'',255,255,0,'',0,''),(761,153,275,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-09-29 11:56:02',20,'',1,1,'',255,255,0,'',0,''),(762,139,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>Florida Agricultural and Mechanical University</a> group','<p>Students,</p>\r\n<p>Here are the committee assignments for Fall 2011 / Spring 2012:</p>\r\n<p> </p>\r\n<p><strong><span style=\"text-decoration: underline;\">EVALUATION COMMITTEE: </span></strong>Solange Artie, Chair;  Olivia Wilson, Co-Chair (Duties: work with STARS to evaluate SLC)</p>\r\n<p>- CLOSED (only chairs on this committee)</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>(FULL)  Community Service: </strong></span>Nathalie Cook, Chair  (Duties:  Community Service projects)</p>\r\n<p>Sharielle Johnson               Jessica Mann</p>\r\n<p>Bonita O\'Banion                 Alycia Gant</p>\r\n<p>Ashley Johnson                 Katrice St. Rose</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Education/Outreach: </strong></span>Angel Bobo, Chair; Jykia Johnson, Co-Chair  (Duties: working with kids in schools, recruitment projects, workshops)</p>\r\n<p>Shina Aofolaju                  Brittany Brown</p>\r\n<p>Olivia Wilson</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Professional Development: </strong></span>Lila Mandela, Chair (Duties:  work with Dr. Black to set up seminars, etc.)</p>\r\n<p>Sharielle Johnson</p>\r\n<p> </p>\r\n<p><strong><span style=\"text-decoration: underline;\">Mentoring: </span></strong> Kai Dumont, Chair;  Sihle Wilson, Co-Chair  (Duties: work with Crystal and CISMO on Mentoring Activities)</p>\r\n<p>Dessirree Gray</p>\r\n<p>Crystal Williams (Honorary)</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Campus Activities: </strong></span> Jessica Mann, Chair  (Duties:  assist STARS in establishing a campus-wide presence through tables, SGA)</p>\r\n<p>Crystal Williams                 Nathalie Cook</p>\r\n<p>Aarmondas Walker</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Social Activities: </strong></span> Melanie Mitchell, Chair  (Duties:  help plan fun, social events for students in the SLC, fun trips, etc.)</p>\r\n<p>Olivia Wilson                    Tene\' Newman</p>\r\n<p>Brittany Brown</p>\r\n<p> </p>','groups.discussion','',17,NULL,NULL,0,0,'2011-09-29 17:47:21',20,'{\"action\":\"group.discussion.create\",\"topic_id\":17,\"topic\":\"FAMU SLC Committee Assignments - Fall 2011\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=6\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=6&topicid=17\"}',1,1,'',255,255,0,'',0,''),(755,117,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Recruitment / Outreach</a>','','groups','',42,NULL,NULL,0,0,'2011-09-28 19:27:39',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=42\"}',1,1,'',255,255,0,'',0,''),(756,117,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>Recruitment / Outreach</a> group','<p>Just ping me at aschow@uncg.edu if you want some STARS postcards or Dot.Diva brochures....</p>\r\n<p> </p>\r\n<p>Cheers,</p>\r\n<p> </p>\r\n<p>ASC</p>','groups.discussion','',16,NULL,NULL,0,0,'2011-09-28 19:54:14',20,'{\"action\":\"group.discussion.create\",\"topic_id\":16,\"topic\":\"Have Marketing Material - STARS postcards and Dot.Diva brochures\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=42\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=42&topicid=16\"}',1,1,'',255,255,0,'',0,''),(2308,318,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-28 16:14:24',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(754,320,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Recruitment / Outreach</a>','','groups','',42,NULL,NULL,0,0,'2011-09-27 16:03:14',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=42\"}',1,1,'',255,255,0,'',0,''),(751,318,0,'{actor} replied a discussion <a href=_QQQ_{discuss_url}_QQQ_>Past REU\'s and Future Ideas?</a> in <a href=_QQQ_{group_url}_QQQ_>{group_name}</a> group','REU\'s are a great way to get your feet wet and learn about research.  Any undergraduate make sure that you do a industrial coop and a REU.  They are both very valuable experiences.  You can search on REUs and we can help to point you to great REU sites. They are generally 8-12 weeks of your summer and generally pay $500/week with housing/meals included.','groups','',38,NULL,NULL,0,0,'2011-09-26 22:27:19',20,'{\"action\":\"group.discussion.reply\",\"wallid\":41,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=38\",\"group_name\":\"REU \\/ Undergraduate Research\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=38&topicid=13\"}',1,1,'',255,255,0,'',0,''),(749,318,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>BPC SIG</a>','','groups','',43,NULL,NULL,0,0,'2011-09-26 14:20:20',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=43\"}',1,1,'',255,255,0,'',0,''),(750,318,318,'Sept 14-Oct 1 Auburn is performing Outreach Training for Alice & Lego Robotics: To see an outline of our outreach training materials goto  <a href=\"http://www.eng.auburn.edu/stars\">http://www.eng.auburn.edu/stars</a> and select Projects and then select Computer Club website. \n\nAuburn STARS work with after-school and in-school activities. Most of our groups are after-school and with one school as part of their formal After School Program. During the regular school day, we only have STARS connected with classes that are not directly tied to state standards. Our local schools have a Venture program as an exploratory class. This is an enrichment program directed toward providing all students a variety of educational opportunities including plays, speakers, interest development centers, mini courses, films, thinking skills development, exploratory classes, and self-directed learning and research.  It includes Auburn City Schools\' accelerated classes, advanced placement, and the International Baccalaureate Program at Auburn High School (description quoted from ACS website).','','profile','',318,NULL,NULL,0,0,'2011-09-26 22:21:59',20,'',1,1,'',255,255,750,'profile.status',750,'profile.status'),(741,315,315,'This is a social network?! Whoah. Crafty STARS.','','profile','',315,NULL,NULL,0,0,'2011-09-22 13:06:27',20,'',1,1,'',255,255,741,'profile.status',741,'profile.status'),(742,73,85,'Thanks for the invite but I will be in Portland, OR for the Grace Hopper Celebration getting fabulous ideas for our Celebration! Have fun!!','','events.wall','',85,0,85,1,0,'2011-09-23 13:21:29',20,'',1,1,'',255,255,742,'events.wall',742,'events.wall'),(1574,228,283,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-07-15 04:21:06',0,