y as we can. And tell your students to do the same.</p>\r\n<p>Thanks!</p>\r\n<p> </p>','groups.discussion','',97,66,0,0,0,'2013-02-04 17:34:04',0,'{\"action\":\"group.discussion.create\",\"topic_id\":97,\"topic\":\"Online Community bugs and feedback\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=66&topicid=97\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2289,748,747,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-01-24 21:15:11',0,'',1,1,'',255,255,0,'',0,''),(1016,358,0,'{actor} is attending <a href=_QQQ_{event_url}_QQQ_>12th Annual Freaks & Geeks with Seminole State College</a>.','','events','',103,NULL,NULL,0,0,'2011-10-17 13:44:51',20,'{\"eventid\":\"103\",\"action\":\"event.join\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=103\"}',1,1,'',255,255,0,'',0,''),(1017,152,152,'Help the UNCG SLC by \"liking\" our facebook page:  UNCG SLC','','profile','',152,NULL,NULL,0,0,'2011-10-17 15:27:15',20,'',1,1,'',255,255,1017,'profile.status',1017,'profile.status'),(1018,354,118,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-10-17 19:02:41',20,'',1,1,'',255,255,0,'',0,''),(1019,358,118,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-10-17 19:02:42',20,'',1,1,'',255,255,0,'',0,''),(1020,119,0,'{actor} is attending <a href=_QQQ_{event_url}_QQQ_>12th Annual Freaks & Geeks with Seminole State College</a>.','','events','',103,NULL,NULL,0,0,'2011-10-18 14:04:14',20,'{\"eventid\":\"103\",\"action\":\"event.join\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=103\"}',1,1,'',255,255,0,'',0,''),(1021,145,149,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-10-18 14:09:53',20,'',1,1,'',255,255,0,'',0,''),(1022,200,149,'{actor} and {target} are now connected','','frien