w connected','','friends','',0,NULL,NULL,0,0,'2011-11-18 19:35:20',20,'',1,1,'',255,255,0,'',0,''),(1141,149,130,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-11-18 20:17:05',20,'',1,1,'',255,255,0,'',0,''),(1142,318,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>Auburn University</a> group','<p>Hi All,</p>\r\n<p>My AU Stars Fall Outreach was at Cary Woods Elementary School and we performed Lego Robotics.  We work with the Venture Program in our school system which is a program for students who are on are above grade level so that they have time for exploratory ventures as a structured class through the year.  The AUSTARS team spent 6 week this fall and will spend 6 more weeks during Spring 2012 working with Ms. Spencer and her excited class. She chose to pull a small group from her full class and we worked during their Lunch/PE period so that they would not miss their regular instruction. Each student worked with their own robot and the group was 75% female.  A couple of the girls complained that this was too hard and confusing, but everyone completed the program and was very excited and proud of their accomplishment with some parents attending our final day.</p>\r\n<p>Activities that they completed were the following: Building Robots and programming figure challenges, programming maze challenge, etc. (for more details of challenges see <a href=\"http://www.eng.auburn.edu/stars/\" title=\"AUSTARS\">www.eng.auburn.edu/stars/</a> for Projects of computer club.</p>','groups.discussion','',35,NULL,NULL,0,0,'2011-11-18 21:19:14',20,'{\"action\":\"group.discussion.create\",\"topic_id\":35,\"topic\":\"STARS Computing Outreach Cary Woods\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=23\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=23&topicid=35\"}',1,1,'',255,255,0,'',0,''),(1143,180,0,'{multiple}