{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>Auburn University</a> group','<p>Happy New Year and its time to start getting organized for Spring  STARS 2012.  We hope everyone can return, but if you can\'t please  suggest 1-2 folks that can take your place.  Thanks Dr. Seals</p>\r\n<p> </p>\r\n<p>Use the link below to provide your availability for meeting next week:</p>\r\n<p> </p>\r\n<p class=\"MsoPlainText\"><a href=\"http://www.doodle.com/ie29xnb66wv8phzn\">http://www.doodle.com/ie29xnb66wv8phzn</a></p>','groups.discussion','',42,NULL,NULL,0,0,'2012-01-11 22:43:32',20,'{\"action\":\"group.discussion.create\",\"topic_id\":42,\"topic\":\"STARS 2012 Intro & Org Meeting\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=23\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=23&topicid=42\"}',1,1,'',255,255,0,'',0,''),(1250,318,38,'UC Berkeley\'s Department of Electrical Engineering and Computer Sciences is proud to be offering SUPERB-ITS:Summer Undergraduate Program in Engineering Research at Berkeley-Information Technology for\nSustainability, sponsored by the National Science Foundation Research Experiences for Undergraduates Program. \n\nDates: June 4 to August 3, 2012.\nhttp://www.eecs.berkeley.edu/Programs/ugrad/superb/superb.html\n','','groups.wall','',38,38,0,0,0,'2012-01-11 22:46:16',20,'',1,1,'',255,255,1250,'groups.wall',1250,'groups.wall'),(1572,214,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>[Started July 10, 2012]  Summer 2012 - Internship or Research?</a>','Brittany Brown\nCSX Technology, Jacksonville, FL\nMay 21st - August 24th\nSupervisors: Andrew Brackett and Regina Sippel','groups.discussion.reply','',58,6,0,0,0,'2012-07-11 22:41:17',0,'{\"action\":\"group.discussion.reply\",\"wallid\":122,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=6\",\"group_name\":\"Florida Agricultural and Mechanical University\",\"discuss_url\":\"index.php?option=co