t interactive conference in the US bringing together creative minds, scientific minds and innovative minds in one place. So please vote and get the word out. VOTES MUST BE CAST BY AUGUST 31!!!  More details on SXSW and the panel picker below. You must log-in to vote!\n\nMore Women Creating Technology Innovations (Bring Gender Diversity in Technology to SXSW):  <a href=\"http://panelpicker.sxsw.com/vote/5688\">http://panelpicker.sxsw.com/vote/5688</a>','','groups.wall','',65,65,0,0,0,'2012-08-27 20:27:05',0,'',1,1,'',255,255,1747,'groups.wall',1747,'groups.wall'),(1748,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Want to see STARS represented at the 2013 SXSW Conference? Help us get on the agenda by voting for our panel! Sessions only make the program by number of votes, so we really need you to vote for our session and forward to all friends you know, share on facebook, twitter and linked-in and get everyone to vote!<br /><br />South by Southwest is the largest interactive conference in the US bringing together creative minds, scientific minds and innovative minds in one place. So please vote and get the word out. VOTES MUST BE CAST BY AUGUST 31!!!  More details on SXSW and the panel picker below. You must log-in to vote!<br /><br />More Women Creating Technology Innovations (Bring Gender Diversity in Technology to SXSW): http://panelpicker.sxsw.com/vote/5688</p>','groups.discussion','',74,65,0,0,0,'2012-08-27 20:28:12',0,'{\"action\":\"group.discussion.create\",\"topic_id\":74,\"topic\":\"Vote for STARS at the 2013 SXSW Conference!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=74\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(1749,410,73,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-08-27 20:31:05',0,'',1,1,'',255,255,0,'',0,''),(1750,652,0,'{actor} is attending a gro