12 Tre\' Addison, Luis Figueroa, Rakim Harvin, and Joh-nette Brown went to Felton Elementary, to work with the 4th, 5th and 6th graders to build the Lego Mindstorm NXT robots.','','groups.wall','',21,21,0,0,0,'2012-10-16 13:31:53',0,'',1,1,'',255,255,1907,'groups.wall',1907,'groups.wall'),(1908,313,0,'On September 27, 2012 Tre\' Addison, Luis Figueroa, Rakim Harvin, and Joh-nette Brown went to Felton Elementary, to work with the 4th, 5th and 6th graders to build the Lego Mindstorm NXT robots.','','groups.wall','',21,21,0,0,0,'2012-10-16 13:32:12',0,'',1,1,'',255,255,1908,'groups.wall',1908,'groups.wall'),(1909,313,0,'On October 2, 2012 Tre\' Addison, Luis Figueroa, Rakim Harvin, and Joh-nette Brown went to Felton Elementary, to work with the 3rd, 4th, 5th and 6th graders to build the Lego Mindstorm NXT robots. Each grade level was split into groups  to program the NXT robots they built. This was the first day we worked with the 3rd graders using the Lego Mindstorm NXT robots.','','groups.wall','',21,21,0,0,0,'2012-10-16 13:41:05',0,'',1,1,'',255,255,1909,'groups.wall',1909,'groups.wall'),(1910,313,0,'On October 4, 2012 Tre\' Addison, Luis Figueroa, Rakim Harvin, and Joh-nette Brown went to Felton Elementary, to work with the 3rd, 4th, 5th and 6th graders to build the Lego Mindstorm NXT robots. Each group had a simple program they had to perform on there NXT robots. The 3rd graders was still building there Lego Mindstorm NXT robots, because they started later then the other grade levels.','','groups.wall','',21,21,0,0,0,'2012-10-16 14:11:44',0,'',1,1,'',255,255,1910,'groups.wall',1910,'groups.wall'),(1911,313,0,'October 9, 2012 Marshall Elementary section 1 \nShilindria Rivers, Eric Collins and Kendall Brice went to Marshall Elementary, to work with the 3rd graders using Microsoft Excel. The SLC students showed them how to use Excel, to create charts and graphs using there favorite sports.','','groups.wall','',21,21,0,0,0,'2012-10-16 14:26:37',0,'',1,1,'',255,255,191