,619,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>STARS Narrative upload</a>','Yay, I see it now!!!!!','groups.discussion.reply','',86,65,0,0,0,'2012-11-15 19:11:45',0,'{\"action\":\"group.discussion.reply\",\"wallid\":168,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=86\"}',1,1,'',255,255,0,'',168,'groups.discussion.reply'),(2115,493,0,'{actor} is attending a group event <a href=_QQQ_{event_url}_QQQ_>Passport to STEM</a>.','','events','',201,0,201,1,0,'2012-11-15 22:32:58',0,'{\"eventid\":\"201\",\"action\":\"events.attendence.attend\",\"event_url\":\"\\/index.php\\/events\\/viewevent\\/201-passport-to-stem?groupid=3\"}',1,1,'',255,255,0,'',0,''),(2116,795,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2012-11-16 02:36:26',0,'',1,1,'',255,255,795,'profile.avatar.upload',795,'profile.avatar.upload'),(2117,795,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2012-11-16 02:36:27',0,'',1,1,'',255,255,795,'profile.avatar.upload',795,'profile.avatar.upload'),(2120,862,0,'Meeting Minutes\nNovember 16, 2012\n	Hello Stars members! We had a very successful meeting today. Our faculty advisor, Heidi Gentry-Kolen, discussed the criteria for the next semester stipend recipients. Unlike this semester, there will be a formal application process to receive one of the stipends. Stipend recipients will need to have minimum cumulative GPA of 2.0, be seeking a degree in a computer or math related program, and will attend the Stars conference in August 2013 as a NWFSC stars member. If you have any questions, contact Heidi Gentry-Kolen at gentryh@nwfsc.edu. Also, Stars has an open enrollment. So, if you know anyone that would like to be a part of this group, they can do so by talking to our project manager and registering on the Stars alliance website  <a href=\"http://community.starsalliance.org/\">http://community.starsalliance.org/</a>. Unfortunately, we did not have a photographer and were unable to take a group photo during this meeting. We will be having one more meeting this semester in a couple weeks. As we did with this meeting, we will use a doodle survey to figure out the best time.\n	Our main topic of discussion during this meeting was determining our current project. After brainstorming ideas and voting. We have decided to mix robotics with gaming and create a mechanical Galaga game with robots operated by a Galaga game on a computer. More details will be released soon.','','groups.wall','',20,20,0,0,0,'2012-11-16 20:42:43',0,'',1,1,'',255,255,2120,'groups.wall',2120,'groups.wall'),(2121,862,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Ideas/Comments on our current project.</p>','groups.discussion','',87,20,0,0,0,'2012-11-16 20:44:35',0,'{\"action\":\"group.discussion.create\",\"topic_id\":87,\"topic\":\"Galaga Project\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=20\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=20&topicid=87\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2903,544,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>NC 7 EA Group</a>','','groups','',94,0,0,1,0,'2013-09-17 19:25:47',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=94\"}',1,1,'',255,255,0,'',0,''),(2904,544,0,'Hey NC 7!','','groups.wall','',94,94,0,0,0,'2013-09-17 19:26:14',0,'',1,1,'',255,255,2904,'groups.wall',2904,'groups.wall'),(2905,544,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-09-17 19:29:43',0,'',1,1,'',255,255,544,'profile.avatar.upload',544,'profile.avatar.upload'),(2906,544,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>North Carolina A&T State University</a>','','group