','I have a rough idea. We could create a galaga-esque program that is slightly altered to be compatable with the robotics side. In the code for that program, we could add lines in every movement operation that output a two byte integer to the board itself. these would be decoded into a light on or off for each square, a raise / lower for each square, and movement for the ship slider. RS nor latches could hold these in place, and voila, you have a galaga board. (in theory)','groups.discussion.reply','',87,20,0,0,0,'2012-11-17 03:12:07',0,'{\"action\":\"group.discussion.reply\",\"wallid\":171,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=20\",\"group_name\":\"Northwest Florida State College\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=20&topicid=87\"}',1,1,'',255,255,0,'',171,'groups.discussion.reply'),(2917,1238,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Indiana University</a>','','groups','',13,0,0,1,0,'2013-09-23 02:38:59',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=13\"}',1,1,'',255,255,0,'',0,''),(2128,45,536,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-11-18 19:25:41',0,'',1,1,'',255,255,0,'',0,''),(2129,42,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>STARS Narrative upload</a>','If you are posting, note that the files on the right hand side are currently ordered with the oldest on top, so you won\'t notice a newly added file until you click More... Its on the to-do list to change this in the next couple of weeks.','groups.discussion.reply','',86,65,0,0,0,'2012-11-18 21:00:06',0,'{\"action\":\"group.discussion.reply\",\"wallid\":173,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=86\