8,0,0,1,0,'2012-11-28 00:41:05',20,'',1,1,'',255,255,2137,'profile.status',2137,'profile.status'),(2138,318,0,'The U.S. Department of Homeland Security (DHS) is offering faculty and students at Minority Serving Institutions an opportunity to participate in a ten-week summer research team experience at university-based DHS Centers of Excellence as part of its DHS Summer Research Program for Minority Serving Institutions. At the end of the summer, faculty participants are encouraged to apply for up to $50,000 in follow-on funding to continue the research collaboration at their home academic institutions during the following academic year. More information, including eligibility guidelines and applications forms, can be found at  <a href=\"http://www.orau.gov/dhseducation/faculty/index.html\">http://www.orau.gov/dhseducation/faculty/index.html</a> \n\nFaculty from all science, technology, engineering and math (STEM) disciplines are encouraged to apply, including faculty in agricultural sciences, biological/life sciences, computer and information sciences, engineering, mathematics, physical sciences, psychology, and social sciences. \n\nWhile preference is shown to early career faculty, past participants have included both early and later career faculty. The program provides early career faculty with research and funding opportunities that can be advantageous when applying for tenure. The program also provides later career faculty with opportunities to apply their well-developed skill sets to homeland security research problems of vital interest to the nation. \n\nPast faculty and student participants have enjoyed the summer research experience, conducted meaningful research, and made new professional connections, many of which have led to fruitful and ongoing research collaborations and additional funding opportunities. Below please find profiles of some of our former participants. \n\nPlease note the upcoming faculty application deadline of January 7, 2013. The faculty application solicits information about faculty research interests and is designed to take little time to complete. \n\nCompleted faculty applications and CVs are forwarded to DHS Centers of interest to the faculty to determine if there is a good fit between faculty research interests and those of the Center. If a good fit can be found, the faculty receives assistance from the Center in developing a research proposal. The faculty then selects one or two students to apply the program as part of the summer research team. Team applications are reviewed by DHS and the Centers, with award winners announced beginning in early March.\n\nPlease call or email Program Manager Patti Obenour with any questions about the application process, the summer research experience, the follow-on funding opportunity at the end of the summer, and/or any other aspect of the program. Patti can be reached at (865) 574-1447, DHSed@orau.org or patti.obenour@orau.org.','','groups.wall','',38,38,0,0,0,'2012-11-28 00:42:41',0,'',1,1,'',255,255,2138,'groups.wall',2138,'groups.wall'),(2139,318,0,'The U.S. Department of Homeland Security (DHS) is offering faculty and students at Minority Serving Institutions an opportunity to participate in a ten-week summer research team experience at university-based DHS Centers of Excellence as part of its DHS Summer Research Program for Minority Serving Institutions for up to $50,000  <a href=\"http://www.orau.gov/dhseducation/faculty/index.html\">http://www.orau.gov/dhseducation/faculty/index.html</a> (for more details see REU Group).','','groups.wall','',65,65,0,0,0,'2012-11-28 00:46:34',0,'',1,1,'',255,255,2139,'groups.wall',2139,'groups.wall'),(2140,318,0,'Security Internships - The ORAU University Partnerships Office is pleased to provide the information below. In 2013 DHS will sponsor about 60 summer internships for students majoring in homeland security disciplines related to science, technology, engineering and mathematics (HS-STEM). Deadline: Jan 15, 2013  <a href=\"http://www.orau.gov/dhseducation/internships/\">http://www.orau.gov/dhseducation/internships/</a> (for more details see REU Group).','','groups.wall','',65,65,0,0,0,'2012-11-28 00:52:48',0,'',1,1,'',255,255,2140,'groups.wall',2140,'groups.wall'),(2141,748,560,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-11-28 20:12:31',0,'',1,1,'',255,255,0,'',0,''),(2142,748,771,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-11-28 20:53:20',0,'',1,1,'',255,255,0,'',0,''),(2143,876,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Northwest Florida State College</a>','','groups','',20,0,0,1,0,'2012-11-29 18:18:00',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=20\"}',1,1,'',255,255,0,'',0,''),(2144,552,0,'Can some one create a check list for what we are responsible for with deadlines! I know at times things have been mentioned, but it would be nice to have them listed to be checked off as completed.','','groups.wall','',66,66,0,0,0,'2012-11-30 16:32:30',0,'',1,1,'',255,255,2144,'groups.wall',2144,'groups.wall'),(2145,125,875,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-11-30 20:47:41',0,'',1,1,'',255,255,0,'',0,''),(2146,239,193,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-12-03 15:46:52',0,'',1,1,'',255,255,0,'',0,''),(2147,862,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>Meeting - 12/07/2012</a>','','events','',216,20,216,0,0,'2012-12-03 23:14:13',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=216&groupid=20\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=4&groupid=20\"}',1,1,'NWFSC P110',255,255,216,'events',216,'events'),(2148,488,0,'Thanks for the posting those opportunities Dr. Seals!','','groups.wall','',65,65,0,0,0,'2012-12-04 19:02:08',0