rything\'s going to  be online. So this means that I <span style=\"text-decoration: underline;\">need</span> to stay up to date with events so that I know when to plan a <em>visit</em> to campus (I live in the UCF area and it\'s almost a 40 min. commute to the SLM campus).</p>\r\n<p>At  home, I provide medical assistance for two family members so I must  manage my time wisely. (most of the homework I do is while waiting in a  Dr.\'s waiting room) For hobbies, I enjoy games (video, tabletop),  LOLcats, drawing, programming, and poking at electronics with a stick  (i.e. experiment with stuff) which is how to create/run a minecraft  server right at the moment.</p>\r\n<p>Anyway, I hope that this brief \'hello\'  should be enough to start with and I hope that it doesn\'t get eaten  again. (Um, would that count as a valid excuse for why someone\'s  homework is turned in late?)</p>\r\n<p>P.S. This thing went \"Derp\" again - session timed out. (yay for notepad!)</p>','groups.discussion','',89,28,0,0,0,'2013-01-10 22:02:01',0,'{\"action\":\"group.discussion.create\",\"topic_id\":89,\"topic\":\"Hello new person here\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=28\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=28&topicid=89\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2190,77,0,'{actor} is attending <a href=_QQQ_{event_url}_QQQ_>Science Fair Judging</a>.','','events','',242,0,242,1,0,'2013-01-11 18:26:06',0,'{\"eventid\":\"242\",\"action\":\"events.attendence.attend\",\"event_url\":\"\\/index.php\\/events\\/viewevent\\/242-science-fair-judging\"}',1,1,'',255,255,0,'',0,''),(2191,73,0,'{actor} created a new group, <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a> in <a href=_QQQ_{category_url}_QQQ_>Working Groups</a>','<p>This group will be the hub for the planning,facilitating and discussion of the 2013 STARS Celebration. All meeting minutes and notes will be posted to the group, as well as announcements and key planning updates. This group is designed for the members of the Celebration Leadership Team.</p>','groups','',79,79,0,0,0,'2013-01-11 19:50:41',0,'{\"action\":\"group.create\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\",\"category_url\":\"index.php?option=com_community&view=groups&task=display&categoryid=18\"}',1,1,'',255,255,2191,'groups.create',2191,''),(2192,310,73,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-01-11 19:50:58',0,'',1,1,'',255,255,0,'',0,''),(2193,73,0,'{actor} uploaded a new avatar for the group, <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','<img src=\"http://community.starsalliance.org/images/avatar/groups/thumb_d0b903f57c0cc390e7bd0d2b.png\" style=\"border: 1px solid #eee;margin-right: 3px;\" />','groups','',79,79,0,0,0,'2013-01-11 19:51:28',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2194,69,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-11 20:11:39',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2195,45,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-11 20:21:50',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2196,77,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-11 20:23:40',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2312,155,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined t