ng 4th and 5th graders) since 2009. Thanks to a National Science Foundation Broadening Participation in Computing Grant we also gave \"seed money\" to other colleges and universities in Georgia to start computing summer camps. We helped 11 colleges and universities start or expand their computing summer camps. You can find information here you will need to start your own computing summer camps:  <a href=\"http://coweb.cc.gatech.edu/ice-gt/1091\">http://coweb.cc.gatech.edu/ice-gt/1091</a>.','','groups.wall','',57,57,0,0,0,'2013-01-30 14:50:47',0,'',1,1,'',255,255,2329,'groups.wall',2329,'groups.wall'),(2795,1161,1156,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 02:31:53',0,'',1,1,'',255,255,0,'',0,''),(2796,1156,1159,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 02:35:12',0,'',1,1,'',255,255,0,'',0,''),(2797,1159,1151,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 02:45:34',0,'',1,1,'',255,255,0,'',0,''),(2798,1151,1156,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 04:47:35',0,'',1,1,'',255,255,0,'',0,''),(2799,1151,1157,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 05:10:55',0,'',1,1,'',255,255,0,'',0,''),(2331,139,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-30 21:07:11',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2332,139,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Celebration 2013</a>','','groups','',79,0,0,1,0,'2013-01-30 21:07:14',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=79\"}',1,1,'',255,255,0,'',0,''),(2333,595,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_