 is to increase the number of women and students from underrepresented groups, including ethnic minorities and persons with disabilities, entering graduate studies in the fields of computer science and engineering. Application Deadline  February 15, 2013. For complete Details see REU Group.','','groups.wall','',65,65,0,0,0,'2013-01-30 23:46:46',0,'',1,1,'',255,255,2340,'groups.wall',2340,'groups.wall'),(2341,318,0,'Deadline: February 15, 2013. The CRA-W/CDC Distributed Research Experiences for Undergraduates (DREU) Program matches promising undergraduates with a faculty mentor for a summer research experience at the faculty member\'s home institution. The objective of the DREU is to increase the number of women and students from underrepresented groups, including ethnic minorities and persons with disabilities, entering graduate studies in the fields of computer science and engineering.  The DREU experience is invaluable for students who are considering graduate school, providing them with a close-up view of what graduate school is really like and also increasing their competitiveness as an applicant for graduate admissions and fellowships.\n\nFunding for the student consists of $6000 for the summer (10 weeks), plus relocation travel assistance when appropriate.  Additional funds may be available to support student conference travel, either during the summer or afterward, and for outreach activities promoting the DREU. An on-line Application for students and faculty mentors, more information about DREU, and webpages authored by previous participants are available at:  <a href=\"http://parasol.tamu.edu/dreu/\">http://parasol.tamu.edu/dreu/</a>  \nApplication Deadline: February 15, 2013, Awards Announced: mid-March 2013\n\nFor more information about the DREU, consult the DREU webpages  <a href=\"http://parasol.tamu.edu/dreu/\">http://parasol.tamu.edu/dreu/</a> or contact the DREU Co-Directors at dreu@cse.tamu.edu.\n\nNancy Amato, Professor, Texas A&M University\nCo-Director, Distributed Research Experiences for Undergraduates (CDC)\nMaria Gini, Professor, University of Minnesota\nCo-Director, Distributed Research Experiences for Undergraduates (CRA-W)\nJulia Hirschberg, Professor, Columbia University\nCo-Director, Distributed Research Experiences for Undergraduates (CRA-W)\nTiffani Williams, Associate Professor, Texas A&M University\nCo-Director, Distributed Research Experiences for Undergraduates (CDC)\n\nThe Computing Research Association (CRA,  <a href=\"http://cra.org)\">http://cra.org)</a> is an association of more than 180 North American academic departments of computer science and computer engineering; laboratories and centers\nin industry, government, and academia engaging in basic computing research; and affiliated professional societies.\n\nThe Coalition to Diversity Computing (CDC,  <a href=\"http://www.cdc-computing.org/)\">http://www.cdc-computing.org/)</a> is a joint organization of the ACM, CRA, and IEEE-CS.\n\nDREU is supported by a grant from the National Science Foundation with additional support from AAAI, the Luce Foundation, and USENIX.','','groups.wall','',38,38,0,0,0,'2013-01-30 23:52:11',0,'',1,1,'',255,255,2341,'groups.wall',2341,'groups.wall'),(2342,848,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>New Members</a>','','groups','',40,0,0,1,0,'2013-01-31 00:57:42',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=40\"}',1,1,'',255,255,0,'',0,''),(2343,236,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Academic Liaisons</a>','','groups','',66,0,0,1,0,'2013-01-31 01:19:43',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\"}',1,1,'',255,255,0,'',0,''),(2344,721,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Academic Liaisons</a>','','groups','',66,0,0,1,0,'2013-01-