cussion.reply','',111,66,0,0,0,'2013-02-26 20:12:07',0,'{\"action\":\"group.discussion.reply\",\"wallid\":225,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\",\"group_name\":\"Academic Liaisons\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=66&topicid=111\"}',1,1,'',255,255,0,'',225,'groups.discussion.reply'),(2566,790,0,'S.C.S.U. activities for the February 26, 2013.\n•	Today we opened packages of “Lego education” pieces for the kids of Felton Laboratory.\n•	We Began today’s activities with first building the Lego contents from the box, this included Lego items of people and small constructs.\n•	Our Aim for today is to instruct the kids of Felton Laboratory on how to follow basic building concepts of Lego’s, by following Step-by-Step instructions; as provided with the contents of the package.\nMembers in attendance includes: Luis Figueroa, Kendall Brice, Tre\' Addison, Rakim Harvin and Shabrasia Woodard.','','groups.wall','',21,21,0,0,0,'2013-02-26 20:52:27',0,'',1,1,'',255,255,2566,'groups.wall',2566,'groups.wall'),(2562,185,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>I would like to hear from all project leaders. Please spend just a few minutes to get me up to speed on your activities.</p>\r\n<p><br /><span style=\"line-height: 1.3em;\"> How are things going?</span></p>\r\n<p>- What have you accomplished so far this semester?</p>\r\n<p>- What are your plans for the rest of the semester?  You should be specific about what you want to do this semester.</p>\r\n<p> </p>\r\n<p>Community building?</p>\r\n<p>- How have you used our new bulletin board to help promote your activities?</p>\r\n<p>- How have you used the Stars Online website?</p>\r\n<p>- What are some plans to build up your project and keep it growing?</p>\r\n<p> </p>\r\n<p>Thanks,<br />Dr. Doman</p>\r\n<p> </p>','groups.discussion','',110,34,0,0,0,'2013-02-26 19:05:27',0,'{\"action\":\"group.discussion.create\",\"topic_id\":110,\"topic\":\"Spring 2013 - Mid semester checkup\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=34\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=34&topicid=110\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2563,77,77,'This video exemplifies why we (STARS) exist and must keep doing what we do.:  <a href=\"http://www.youtube.com/watch?v=nKIu9yen5nc\">http://www.youtube.com/watch?v=nKIu9yen5nc</a>','','profile','',77,0,0,1,0,'2013-02-26 19:32:00',20,'',1,1,'',255,255,2563,'profile.status',2563,'profile.status'),(2567,508,357,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-02-26 22:19:46',0,'',1,1,'',255,255,0,'',0,''),(2876,637,0,'{actor} is attending a group event <a href=_QQQ_{event_url}_QQQ_>Sept EA Affinity Group Meeting</a>.','','events','',368,0,368,1,0,'2013-09-06 17:30:48',0,'{\"eventid\":\"368\",\"action\":\"events.attendence.attend\",\"event_url\":\"\\/index.php\\/events\\/viewevent\\/368-sept-ea-affinity-group-meeting?groupid=86\"}',1,1,'',255,255,0,'',0,''),(2569,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<h2>Empowering 21st Century Tech Leaders!</h2>\r\n<p>Call for Participation is <strong>Now Open through April 28, 2013</strong>! Visit the Celebration website to access the submission site and review the session tracks, guidelines and dates!</p>\r\n<p>http://starscelebration.org/stars-celebration-cfp</p>\r\n<p>The STARS Celebration seeks to promote inspiration, creativity and  innovation in its participants as well as a sense of community. This  year\'s them of <em>empowerment </em>aims to develop and share the  talents we have within. Join us for an exciting and informative blend of  cutting-edge sessions, shared experiences, and camaraderie with other  computing students and professionals.</p>\r\n<p>We invite all computing researchers, faculty, staff, partners, and  students to contribute panels, presentations, workshops, lightening  talks, birds-of-a-feather, or posters.</p>\r\n<p>See you in Atlanta!</p>','groups.discussion','',112,65,0,0,0,'2013-02-28 16:39:28',0,'{\"action\":\"group.discussion.create\",\"topic_id\":112,\"topic\":\"STARS Celebration 2013 Call For Participation Open!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=112\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2570,225,546,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-01 13:46:26',0,'',1,1,'',255,255,0,'',0,''),(2572,536,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>Spring 2013 - Mid semester checkup</a>','So far: I have 2 speakers and 1 tour in the works\n \nRest of the semester:\nKarissa, a Winthrop Alum will be here on the 27th of March \nCAVEMODE will be visiting in April \nThe UNCC Lab Tour is still being worked out \n\nBulletin board:\nThe UNCC  lab tour announcement was placed on the board\nThe flyer for Karissa\'s visit will be up shortly\n\nI have not really used the STARS Online Community\nI need to become more familiar with the website\n\n\n\n','groups.discussion.reply','',110,34,0,0,0,'2013-03-04 02:50:36',0,'{\"action\":\"group.discussion.reply\",\"wallid\":228,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=34\",\"group_name\":\"Winthrop University\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=34&topicid=110\"}',1,1,'',255,255,0,'',228,'groups.discussion.reply'),(2574,69,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-03-05 14:50:28',0,'',1,1,'',255,255,69,'profile.avatar.upload',69,'profile.avatar.upload'),(2575,69,69,'Check out this video:   <a href=\"http://www.code.org/\">http://www.code.org/</a>','','profile','',69,0,0,1,0,'2013-03-05 15:08:04',20,'',1,1,'',255,255,2575,'profile.status',2575,'profile.status'),(2576,122,122,'Recruiting undergraduates for summer research at NC State!\n <a href=\"http://research.csc.ncsu.edu/iim-reu/\">http://research.csc.ncsu.edu/iim-reu/</a>','','profile','',122,0,0,1,0,'2013-03-06 18:53:21',20,'',1,1,'',255,255,2576,'profile.status',2576,'profile.status'),(2577,696,122,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-06 18:55:20',0,'',1,1,'',255,255,0,'',0,''),(2578,318,122,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-06 18:55:24',0,'',1,1,'',255,255,0,'',0,''),(2579,509,122,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-06 18:55:27',0,'',1,1,'',255,255,0,'',0,''),(2580,122,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>REU / Undergraduate Research</a>','','groups','',38,0,0,1,0,'2013-03-06 18:56:51',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=38\"}',1,1,'',255,255,0,'',0,''),(2581,122,0,'We\'re accepting applications to the REU Site at NC State (Raleigh, NC)\nTitle: Intelligent and Interactive Media REU: Designing and evaluating serious games, narrative and visual experiences, interfaces, and intelligence for games and education\n <a href=\"http://research.csc.ncsu.edu/iim-reu/\">http://research.csc.ncsu.edu/iim-reu/</a>\nApply ASAP! Program May 21-Aug 1, $500/wk stipend, housing, food provided!','','groups.wall','',38,38,0,0,0,'2013-03-06 18:58:48',0,'',1,1,'',255,255,2581,'groups.wall',2581,'groups.wall'),(2582,481,69,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-08 19:28:01',0,'',1,1,'',255,255,0,'',0,''),(2583,1007,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>Spring 2013 - Mid semester checkup</a>','So far, I have a mockup of the website created to base the design after.  I have researched WordPress and talked to the HelpDesk about it.   Should be able to use the last version of WordPress before the current one.  Nick contacted the HelpDesk as well, and there has been some confusion about what we need to do to set up the server.   Need to discuss that when school starts again.  I also have a wireframe of the website that shows the architecture of what pages will be on the website.  It is a bit different from the previous version.\n\nAs for the rest of the semester, here is my anticipated schedule: \n\nMarch 25:      Server should be set up, WordPress should be installed.  Begin Development\nMarch 28:      Request to members for content and set up photoshoots at meeting\nApril 18:         Photos should all be taken\nApril 26:         WordPress Development Complete\n\nPages on the website:\nHome, About, Projects, Tutoring, Join, Blog, Contact Us\n\nProjects will have a dropdown menu for the current projects and previous projects.  Tutoring will have a dropdown menu for the classes that have tutoring available.\n\nA content slider and calendar are ideal, but their completion will depend on the progress.  A content slider will receive greater priority, as the calendar can simply be a list of upcoming events.\n\nHaven\'t used the Stars online website. Need to post documents in the Dropbox though.  \n\nHopefully, I can show Jesse the website at the end of the semester so that he can take it over next semester.   \nAlso, students should be encouraged to post on the blog next semester.','groups.discussion.reply','',110,34,0,0,0,'2013-03-17 19:18:11',0,'{\"action\":\"group.discussion.reply\",\"wallid\":230,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=34\",\"group_name\":\"Winthrop University\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=34&topicid=110\"}',1,1,'',255,255,0,'',230,'groups.discussion.reply'),(2584,185,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Please check out the event on Karissa Martindale.  If you can come, update the event</p>\r\n<p> </p>\r\n<p>I\'d like to see how this online community works.</p>','groups.discussion','',113,81,0,1,0,'2013-03-18 20:35:34',0,'{\"action\":\"group.discussion.create\",\"topic_id\":113,\"topic\":\"Karissa Martindale Speaking Date\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=81\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=81&topicid=113\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2585,139,0,'March Meeting:  Monday March 25 @ 6 p.m. in Rm. 208B (MANDATORY)','','groups.wall','',6,6,0,0,0,'2013-03-19 14:40:24',0,'',1,1,'',255,255,2585,'groups.wall',2585,'groups.wall'),(2586,139,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>STARS March Meeting (MANDATORY)</a>','','events','',324,6,324,0,0,'2013-03-19 14:45:05',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=324&groupid=6\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=4&groupid=6\"}',1,1,'TECH A, RM. 208B',255,255,324,'events',324,'events'),(2587,400,211,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-03-19 15:11:27',0,'',1,1,'',255,255,0,'',0,''),(2588,104,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>It\'s that time of year again- SLC Alumni updates. Attached is a comprehensive spreadsheet of every SLC student to date. Please provide updates on your student whereabouts in the NOTES column by <strong>April 5</strong>. Summary:</p>\r\n<p>1. fill in graduation dates and degrees obtained by your former SLC students in the indicated columns</p>\r\n<p>2. this list contains what we have on record from your past submissions of this information</p>\r\n<p>3. return the completed list for your school without altering the spreadsheet format by email to audrey.rorrer@uncc.edu</p>\r\n<p><strong>This is due by April 5th. </strong> We rely on these updates to compile retention data 