0,0,0,'2013-03-27 20:41:14',0,'',1,1,'',255,255,2599,'groups.wall',2599,'groups.wall'),(2600,441,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-04-01 15:52:30',0,'',1,1,'',255,255,441,'profile.avatar.upload',441,'profile.avatar.upload'),(2601,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>The deadline is quickly approaching to submit your posters, presentations, panels, workshops, lightning talks or BoF for this year\'s STARS Celebration. Sumbissions are due <strong>by midnight April 12. </strong>Everyone is encouraged to submit a topic! If you have industry or academic contacts that you think would also add to this year\'s conference theme, Empowering 21st Century Tech Leaders, encourage them to submit as well!</p>\r\n<p> </p>\r\n<p>Visit the submission page <a href=\"http://www.starscelebration.org/stars-celebration-cfp\" target=\"_blank\">here!</a> We look froward to seeing you in August!</p>','groups.discussion','',116,65,0,0,0,'2013-04-01 15:57:11',0,'{\"action\":\"group.discussion.create\",\"topic_id\":116,\"topic\":\"STARS Celebration 2013 - Call For Participation Deadline April 12!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=116\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2602,400,545,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-04-02 11:23:25',0,'',1,1,'',255,255,0,'',0,''),(2603,139,0,'Students,\n\nPlease read the attached slides regarding what I talked about at the March meeting. Important things to note:\n\n1) Stipends:\n- Fall 2012: still working on; been delayed, largely because WE have not been active!\n- Spring 2013: looking very slim, due to very poor activity this semester by you (no events planned)\n\n2) Restructuring of the Alliance:\n- ALL students MUST re-apply to the program to be considered for Fall 2013 funding\n- application is attached to this email; must be returned by April 8\n- you cannot participate in the program in ANY way without having an application on file\n- if you want to participate without being funded, you can still do so, but must apply as an Associate\n- Applications will also be located outside my office door\n\n3) CyberTriathlon:\n- planning to have in May (2nd or 3rd weekend)\n- need students to assist with recruiting, other activities:\na) going out to local high schools\nb) assisting with planning (i.e., choosing activities, other logistics)\nc) assisting with events scheduled\n- Events:\na) Welcome Meeting: scheduled for Sat. Apr. 27 (students meet their teams)\nb) Actual Event: either May 11 or May 18\n- if interested in assisting, please attend:\nCYBERTRIATHLON PLANNING MEETING - Wednesday, Apr. 3, @ 6 p.m. in CIS\nConference Room\n\n4) STARS Celebration 2013:\n- will be in Atlanta, August 15-18\n- ONLY 6 STARS STUDENTS CAN ATTEND:\n- must notify me ASAP if you wish to attend (no later than Friday, April 5)\n- all travel to and from event will be reimbursed','','groups.wall','',6,6,0,0,0,'2013-04-02 15:31:07',0,'',1,1,'',255,255,2603,'groups.wall',2603,'groups.wall'),(2604,139,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>FAMU CyberTriathlon Meeting</a>','','events','',326,6,326,0,0,'2013-04-02 15:33:21',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=326&groupid=6\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=4&groupid=6\"}',1,1,'CIS Conference Room',255,255,326,'events',326,'events'),(2605,139,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>STARS Applications Due - April 5</a>','','events','',327,6,327,0,0,'2013-04-02 15:36:06',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=327&groupid=6\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=7&groupid=6\"}',1,1,'CIS',255,255,327,'events',327,'events'),(2606,69,0,'ESC minutes from the March 28, 2013 teleconference are posted here.','','groups.wall','',5,5,0,0,0,'2013-04-03 13:14:19',0,'',1,1,'',255,255,2606,'groups.wall',2606,'groups.wall'),(2607,531,526,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-04-03 16:08:52',0,'',1,1,'',255,255,0,'',0,''),(2608,525,526,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-04-03 16:08:56',0,'',1,1,'',255,255,0,'',0,''),(2609,134,134,'Our group is trying to start a CS Unplugged relationship with a local Elementary School. Can anyone share insights with me on which activities are most effective and fun for 5th grade students? \n\nOr any other helpful hints you may have from experience when working with 5th graders or CS Unplugged in general?\n\nTHANK YOU!!!','','profile','',134,0,0,1,0,'2013-04-09 14:06:50',20,'',1,1,'',255,255,2609,'profile.status',2609,'profile.status'),(2618,134,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>CS UNPLUGGED</a>','Thank you Veronica!','groups.discussion.reply','',119,65,0,0,0,'2013-04-09 16:19:52',0,'{\"action\":\"group.discussion.reply\",\"wallid\":234,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',234,'groups.discussion.reply'),(2619,45,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>testing</p>','groups.discussion','',121,64,0,1,0,'2013-04-09 16:25:07',0,'{\"action\":\"group.discussion.create\",\"topic_id\":121,\"topic\":\"blah\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=64\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=64&topicid=121\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2612,134,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Our group is trying to start a CS Unplugged relationship with a local  Elementary School. Can anyone share insights with me on which activities  are most effective and fun for 5th grade students? <br /><br />Or any other helpful hints you may have from experience when working with 5th graders or CS Unplugged in general?<br /><br />THANK YOU!!!</p>','groups.discussion','',119,65,0,0,0,'2013-04-09 14:36:28',0,'{\"action\":\"group.discussion.create\",\"topic_id\":119,\"topic\":\"CS UNPLUGGED\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2879,637,0,'me neither..i\'ve been trying since 1','','events.wall','',368,86,368,0,0,'2013-09-06 17:31:46',0,'',1,1,'',255,255,2879,'events.wall',2879,'events.wall'),(2880,1189,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-09-07 19:43:35',0,'',1,1,'',255,255,1189,'profile.avatar.upload',1189,'profile.avatar.upload'),(2617,273,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>CS UNPLUGGED</a>','At NC State we use a variety of the CSUnplugged activities for an intro to our outreach program.  We\'ve had success with Sorting Networks/Algorithms Sidewalk chalk, Finite State Machine Treasure Hunt, Public Key Encryption, and Image Representation (color by number).  We also use the binary activity and the Turing Game.\nThe activities that have students involved and actively doing something they seem to have more fun with.  We try to avoid the activities that are purely worksheets. \n\nhttp://csunplugged.org/finite-state-automata\nhttp://csunplugged.org/public-key-encryption (video activity)\nhttp://csunplugged.org/sorting-networks (chalk game, but with other sorting algorithms too, rotate the kids to different stations.)\nhttp://csunplugged.org/image-representation\n\nhttp://csunplugged.org/turing-test\n','groups.discussion.reply','',119,65,0,0,0,'2013-04-09 16:12:58',0,'{\"action\":\"group.discussion.reply\",\"wallid\":233,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',233,'groups.discussion.reply'),(2614,653,112,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-04-09 14:48:53',0,'',1,1,'',255,255,0,'',0,''),(2615,273,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>CS UNPLUGGED</a>','At NC State we\'ve had success with the Sorting Networks game (sidewalk chalk).  Other recent favorites include image representation (color by number), public key encryption, and the Finite State Automata treasure hunt game. We cover binary numbers and the turing game too.\n\nhttp://csunplugged.org/sorting-networks (we vary this by having other sorting algorithms also in chalk, and rotate the children to different stations.)\n\nhttp://csunplugged.org/image-representation\nhttp://csunplugged.org/public-key-encryption (game in the video\nhttp://csunplugged.org/finite-state-automata)\n\n','groups.discussion.reply','',118,65,0,0,0,'2013-04-09 15:59:41',0,'{\"action\":\"group.discussion.reply\",\"wallid\":232,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=118\"}',1,1,'',255,255,0,'',232,'groups.discussion.reply'),(2620,45,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>blahb lahb lah</p>','groups.discussion','',122,64,0,1,0,'2013-04-09 16:28:50',0,'{\"action\":\"group.discussion.create\",\"topic_id\":122,\"topic\":\"Creating multiple\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=64\",\"topic_url\":\"i