worth looking into, the developers at MIT have made it possible to program and communicate with certain Lego sets. If you\'re interested in something that combines robotics with Scratch, you could look into the WeDo construction.\n\nhttp://info.scratch.mit.edu/WeDo','groups.discussion.reply','',119,65,0,0,0,'2013-04-09 17:04:02',0,'{\"action\":\"group.discussion.reply\",\"wallid\":235,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',235,'groups.discussion.reply'),(2625,875,875,'This age group loves to make things happen. There are a lot of pre-packaged, non-solder Arduino kits that kids can put together and then make little programs for really cool devices. Some of the kids will really get into the construction part and others will just eat up the sketch portion. They can do all kinds of things and have their little device connect to the internet and give them feedback every day.','','profile','',875,0,0,1,0,'2013-04-10 01:10:52',20,'',1,1,'',255,255,2625,'profile.status',2625,'profile.status'),(2626,104,104,'How to complete the spring narrative report (recorded webinar):  <a href=\"http://www.anymeeting.com/WebConference-beta/RecordingDefault.aspx?c_psrid=ED51DD83844D\">http://www.anymeeting.com/WebConference-beta/RecordingDefault.aspx?c_psrid=ED51DD83844D</a>','','profile','',104,0,0,1,0,'2013-04-10 15:57:22',20,'',1,1,'',255,255,2626,'profile.status',2626,'profile.status'),(2824,215,0,'{actor} is attending a group event <a href=_QQQ_{event_url}_QQQ_>Sept EA Affinity Group Meeting</a>.','','events','',368,0,368,1,0,'2013-08-29 18:27:41',0,'{\"eventid\":\"368\",\"action\":\"events.attendence.attend\",\"event_url\":\"\\/index.php\\/events\\/viewevent\\/368-sept-ea-affinity-group-meeting?groupid=86\"}',1,1,'',255,255,0,'',0,''),(2881,1201,0,'{multiple}{actors}{/multiple}{sin