ing/problem solving.)<br /><br />Which do you think was most rewarding for the participants?<br /><br />What was the least rewarding aspect of tutoring? If this relates to a program feature, Please suggest an improvement to this feature of the program.<br /><br />Would you like to work with the tutoring program in the future? <br />Please check one choice.     ___YES       ___NO<br /><br />Please make suggestions to improve the program.<br /><br />Please suggest a friend or someone that you tutored that would be suitable for tutoring mentor next summer or next fall.</p>','groups.discussion','',130,23,0,0,0,'2013-04-22 17:20:44',0,'{\"action\":\"group.discussion.create\",\"topic_id\":130,\"topic\":\"Journal Tutoring Template\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=23\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=23&topicid=130\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2817,637,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>EA Affinity Group 2013-14</a>','','groups','',86,0,0,1,0,'2013-08-28 21:42:19',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=86\"}',1,1,'',255,255,0,'',0,''),(2794,42,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>Additional discussion Test</a>','Participant?','groups.discussion.reply','',151,64,0,1,0,'2013-08-22 17:56:55',0,'{\"action\":\"group.discussion.reply\",\"wallid\":249,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=64\",\"group_name\":\"Development Team\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=64&topicid=151\"}',1,1,'',255,255,0,'',249,'groups.discussion.reply'),(2792,1160,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>EA Affinity Group 2013-14</a>','','groups','',86,0,0,1,0,'2013-08-22 14:52:49',0,'{\"group_