n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times\",\"serif\";\r\n	mso-bidi-font-family:\"Times New Roman\";}\r\n\r\n\r\n<p> </p>\r\n<p>To submit a nomination, send the following to Ashley Peeler (ashley.peeler@uncc.edu):</p>\r\n<p>Nominee Name, Institution, email and award being nominated. Please also include answers to the questions below.</p>\r\n<p>  Normal 0     false false false  EN-US X-NONE X-NONE              MicrosoftInternetExplorer4              </p>\r\n<p>                                                                                                                                             \r\n\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times\",\"serif\";\r\n	mso-bidi-font-family:\"Times New Roman\";}\r\n\r\n</p>\r\n<ol>\r\n<li><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;; mso-fareast-font-family: Cambria; mso-bidi-font-family: Cambria;\"><span style=\"mso-list: Ignore;\"><span style=\"font: 7.0pt &quot;Times New Roman&quot;;\"> </span></span></span><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;;\">What significant contributions did this nominee make to STARS over the last academic year (150 words or less) </span></li>\r\n<li><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;;\">What achievements or outcomes resulted from their contributions that have made a significant difference to STARS and our mission? (150 words or less) <span style=\"color: red;\"> </span></span> </li>\r\n<li><span style=\"font-size: 14.0pt; mso-bidi-font-size: 10.0pt; font-family: &quot;Cambria&quot;,&quot;serif&quot;;\"> </span><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;;\">What other aspects of this nominee make them an excellent candidate to be recognized as a STARS leader and/or innovative partner? (150 words or less) </span></li>\r\n</ol>\r\n<p><strong>Nominations due July 1, 2013. </strong>Please let Ashley know if you have additional questions!</p>\r\n<p> </p>','groups.discussion','',131,65,0,0,0,'2013-05-15 19:03:02',0,'{\"action\":\"group.discussion.create\",\"topic_id\":131,\"topic\":\"STARS Award Nominations - now being accepted!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=131\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2683,1091,942,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-05-17 00:36:56',0,'',1,1,'',255,255,0,'',0,''),(2684,1095,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Northwest Florida State College</a>','','groups','',20,0,0,1,0,'2013-05-17 07:22:19',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=20\"}',1,1,'',255,255,0,'',0,''),(2685,797,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-05-22 17:15:02',0,'',1,1,'',255,255,797,'profile.avatar.upload',797,'profile.avatar.upload'),(2686,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Please upload your camera ready file (preferably PDF format) for the Celebration Poster Competition by <strong>Friday, May 31.</strong> You will need to submit your file at this time to be considered for the judging and competition portion of the poster session. Posters not submitted by this date will not be part of the competition but can still be displayed.</p>\r\n<p><strong>To submit follow these instructions:</strong></p>\r\n<h2>Uploading a Camera-Ready Submission</h2>\r\n<ol style=\"line-height: 0.6em;\">\r\n<li>Log in to the <a href=\"https://www.easychair.org/conferences/?conf=starscelebration2013\" target=\"_blank\">STARS Celebration 2013 Login Page</a>.</li>\r\n<li>Select <em>proceedings author.</em></li>\r\n<li>In the top menu, select the appropriate <em>Paper </em>.</li>\r\n<li>Select <em>Submit a New Version</em>.</li>\r\n<li>In the Upload Paper section, browse to your submission file.</li>\r\n<li>Click <em>Submit a New Version</em>.</li>\r\n<li>Confirm your submission was successful by downloading the submission.</li>\r\n</ol>\r\n<p>NOTE: If the system does not confirm your submission, go to the <em>Overview</em> menu to confirm that your paper is listed.</p>\r\n<p>If you have not received an electronic notification that your poster or abstract was accepted, please email me at <strong>ashley.peeler@uncc.edu </strong>ASAP.</p>\r\n<p>Thanks and good luck!</p>','groups.discussion','',132,65,0,0,0,'2013-05-23 17:11:29',0,'{\"action\":\"group.discussion.create\",\"topic_id\":132,\"topic\":\"Deadline for Camera Ready Posters for Celebration Judging Extended\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=132\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2687,395,0,'**REMINDER*** - The deadline for early bird registration for Celebration is this Saturday, June 1.  Please be sure to register before then.\n <a href=\"http://www.cvent.com/events/stars-celebration-2013/event-summary-fdbac75523d1447e9c55562d0ccf806d.aspx\">http://www.cvent.com/events/stars-celebration-2013/event-summary